import React from "react";
import '../AboutProject/AboutProject.css';

function AboutProject() {
  return (
    <section className="about-project">
      <h2 className="about-project__title">О проекте</h2>
      <article className="about-project__description">
        <p className="about-project__description-title">Дипломный проект включал 5 этапов</p>
        <p className="about-project__description-title">На выполнение диплома ушло 5 недель</p>
        <p className="about-project__description-text">Составление плана, работу над бэкендом, вёрстку, 
        добавление функциональности и финальные доработки.</p>
        <p className="about-project__description-text">У каждого этапа был мягкий и жёсткий дедлайн, 
        которые нужно было соблюдать, чтобы успешно защититься.</p>
      </article>
      <div className="about-project__interval">
        <p className="about-project__interval_one">1 неделя</p>
        <p className="about-project__interval_two">4 недели</p>
        <p className="about-project__interval-text">Back-end</p>
        <p className="about-project__interval-text">Front-end</p>
      </div>
    </section>
  );
}
export default AboutProject;
